import React from 'react'
import Toggleable from './Togglable'
const Blog = ({ blog }) => {
  const blogStyle = {
    paddingTop: 10,
    paddingLeft: 2,
    border: 'solid',
    borderWidth: 1,
    marginBottom: 5
  }

  return (
    <div style={blogStyle}>
      <Toggleable 
      buttonLabel={`${blog.title} ${blog.author}`}></Toggleable>
      <div style={blogStyle}>
        {blog.title} {blog.author}
        {blog.url}
        {blog.likes}
        <button style='submit'>like</button>
        <p>Added by </p> {blog.user}

      </div>

    </div>
  )
} 

export default Blog
